import React from "react";

const Dashbord = () => {
    return (
        <>
            <nav className="db dt-l tr-41 w-100 border-box ph5-l bg-green">
                <button className="db dtc-l v-mid mid-gray link dim w-100 w-25-l tl b--none bg-transparent tl-l mb2 mb0-l" title="Home">
                    <img src="https://www.wikipedia.org/portal/wikipedia.org/assets/img/Wikipedia-logo-v2.png" className="dib w2 h2 br-100" alt="Student logo" />
                    hiii
                </button>
            </nav>

        </>
    );
}

export default Dashbord;
